import SAM from './componenets/SAM'
import Background from './componenets/Background';
import Navbar from './componenets/Navbar';
import Topnav from './componenets/Topnav';
import Phonenav from './componenets/PhoneNav';
import Messages from './componenets/Messages';
import Setting from './componenets/Setting';
import Assets from './componenets/Assets';
import LogIn from './componenets/LogIn';
import SignUP from './componenets/SignUp';
import { useState } from 'react';
import './App.css';
function App() {
  const [isDarkMode, setIsDarkMode] = useState(true);
  const [FontSize, setFontSize] = useState("fs-2");

  const toggleMode = () => {
    setIsDarkMode(prevMode => !prevMode);
  };

  return (
    <>
      <Background />
      <div className='container-fluid m-0 p-0 body'>
        <div className='row m-0 p-0 justify-content-end'>
          {window.innerWidth > 1100 ? <Navbar isDarkMode={isDarkMode} toggleMode={toggleMode} /> : null}
          <div className="row col-xl-10 p-0 m-0 col-lg-9 col-md-8 col-12">
            {window.innerWidth > 1100 ? <Topnav isDarkMode={isDarkMode} toggleMode={toggleMode} /> : <Phonenav isDarkMode={isDarkMode} toggleMode={toggleMode} />}
            <div className='p-5 pt-4 d-flex m-0 flex-column row justify-content-center'>
              <SAM isDarkMode={isDarkMode} toggleMode={toggleMode} FontSize={FontSize} setFontSize={setFontSize} />
              <Setting isDarkMode={isDarkMode} toggleMode={toggleMode} FontSize={FontSize} setFontSize={setFontSize} />
              <Messages isDarkMode={isDarkMode} toggleMode={toggleMode} FontSize={FontSize} setFontSize={setFontSize} />
              <Assets isDarkMode={isDarkMode} toggleMode={toggleMode} FontSize={FontSize} setFontSize={setFontSize} />
            </div>
          </div>
        </div>
      </div>
    </>
  );

}
export default App;
